(20, 'Front-end developer', '', 'fullTime', 45200.00, 'We are seeking a highly skilled and motivated Front-End Developer to join our IT School Department. As a front-end developer, you will be responsible for designing and implementing the visual elements and user interfaces of the school\'s internal and external web applications. You will work closely with the development team, educators, and other stakeholders to deliver an engaging, intuitive, and functional user experience for students, faculty, and administrative users.\r\n\r\n\r\n\r\nTechnical Skills:\r\nProficiency in Front-End Technologies:\r\n\r\nHTML5: Strong understanding of HTML for structuring web pages.\r\nCSS3: Expertise in styling and layout using modern CSS (flexbox, grid, etc.).\r\nJavaScript: Competence in vanilla JavaScript, as well as modern ES6+ features like arrow functions, promises, async/await, etc.\r\nJavaScript Frameworks: Familiarity with popular libraries and frameworks such as:\r\nReact.js (preferred)\r\nVue.js or Angular (optional, depending on the project)\r\nVersion Control: Proficiency in using Git for source code management (e.g., GitHub, GitLab).\r\n\r\nEducational Requirements:\r\nDegree:\r\nA degree in Computer Science, Information Technology, Web Development, or a related field (or equivalent practical experience).\r\nCertifications (Optional):\r\nAdditional certifications in front-end development or specific technologies (like React.js or JavaScript frameworks) can be a plus, though not always required.\r\nExperience:\r\nPrior experience in front-end development, ideally in a collaborative team setting, is often preferred.\r\nExperience in an educational or non-profit environment could be advantageous but not mandatory.\r\n\r\n\r\n\r\nCareer Advancement:\r\n\r\nDevelop a portfolio of work that showcases real-world applications, which will be valuable for future job opportunities.\r\nPotential career progression to roles such as Full-Stack Developer, UI/UX Designer, or Lead Front-End Developer.', 'We are seeking a highly skilled and motivated Front-End Developer to join our IT School Department. As a front-end developer, you will be responsible for designing and implementing the visual elements and user interfaces of the school\'s internal and external web applications. You will work closely with the development team, educators, and other stakeholders to deliver an engaging, intuitive, and functional user experience for students, faculty, and administrative users.\r\n\r\n\r\n\r\nTechnical Skills:\r\nProficiency in Front-End Technologies:\r\n\r\nHTML5: Strong understanding of HTML for structuring web pages.\r\nCSS3: Expertise in styling and layout using modern CSS (flexbox, grid, etc.).\r\nJavaScript: Competence in vanilla JavaScript, as well as modern ES6+ features like arrow functions, promises, async/await, etc.\r\nJavaScript Frameworks: Familiarity with popular libraries and frameworks such as:\r\nReact.js (preferred)\r\nVue.js or Angular (optional, depending on the project)\r\nVersion Control: Proficiency in using Git for source code management (e.g., GitHub, GitLab).\r\n\r\nEducational Requirements:\r\nDegree:\r\nA degree in Computer Science, Information Technology, Web Development, or a related field (or equivalent practical experience).\r\nCertifications (Optional):\r\nAdditional certifications in front-end development or specific technologies (like React.js or JavaScript frameworks) can be a plus, though not always required.\r\nExperience:\r\nPrior experience in front-end development, ideally in a collaborative team setting, is often preferred.\r\nExperience in an educational or non-profit environment could be advantageous but not mandatory.\r\n\r\n\r\n\r\nCareer Advancement:\r\n\r\nDevelop a portfolio of work that showcases real-world applications, which will be valuable for future job opportunities.\r\nPotential career progression to roles such as Full-Stack Developer, UI/UX Designer, or Lead Front-End Developer.', 'We are seeking a highly skilled and motivated Front-End Developer to join our IT School Department. As a front-end developer, you will be responsible for designing and implementing the visual elements and user interfaces of the school\'s internal and external web applications. You will work closely with the development team, educators, and other stakeholders to deliver an engaging, intuitive, and functional user experience for students, faculty, and administrative users.\r\n\r\n\r\n\r\nTechnical Skills:\r\nProficiency in Front-End Technologies:\r\n\r\nHTML5: Strong understanding of HTML for structuring web pages.\r\nCSS3: Expertise in styling and layout using modern CSS (flexbox, grid, etc.).\r\nJavaScript: Competence in vanilla JavaScript, as well as modern ES6+ features like arrow functions, promises, async/await, etc.\r\nJavaScript Frameworks: Familiarity with popular libraries and frameworks such as:\r\nReact.js (preferred)\r\nVue.js or Angular (optional, depending on the project)\r\nVersion Control: Proficiency in using Git for source code management (e.g., GitHub, GitLab).\r\n\r\nEducational Requirements:\r\nDegree:\r\nA degree in Computer Science, Information Technology, Web Development, or a related field (or equivalent practical experience).\r\nCertifications (Optional):\r\nAdditional certifications in front-end development or specific technologies (like React.js or JavaScript frameworks) can be a plus, though not always required.\r\nExperience:\r\nPrior experience in front-end development, ideally in a collaborative team setting, is often preferred.\r\nExperience in an educational or non-profit environment could be advantageous but not mandatory.\r\n\r\n\r\n\r\nCareer Advancement:\r\n\r\nDevelop a portfolio of work that showcases real-world applications, which will be valuable for future job opportunities.\r\nPotential career progression to roles such as Full-Stack Developer, UI/UX Designer, or Lead Front-End Developer.', 0, '0', '0', 1, '2024-11-13 18:30:34', '2024-11-13 18:30:34', 19),
(23, 'Cybersecurity Hardware Engineer ', '', 'fullTime', 33400.00, 'The role will also include troubleshooting hardware vulnerabilities, responding to security incidents, and recommending improvements to bolster the overall IT security posture of the institution.', 'Education: Bachelor\'s degree in Computer Science, Information Technology, Cybersecurity, or a related field.\r\nExperience: At least 1-3 years of hands-on experience in cybersecurity, network engineering, or hardware engineering, with a strong emphasis on security.\r\nTechnical Skills:\r\nExperience with network hardware (e.g., routers, switches, firewalls, VPNs, IDS/IPS).\r\nKnowledge of security protocols (e.g., SSL/TLS, IPsec, VPNs).\r\nFamiliarity with cybersecurity frameworks and best practices (e.g., NIST, ISO/IEC 27001).\r\nExperience with security monitoring tools and platforms.\r\nFamiliarity with scripting or programming languages (e.g., Python, Bash, PowerShell) for automation and troubleshooting.\r\nStrong understanding of risk management and vulnerability assessments.', 'Professional development opportunities (e.g., training, certifications).\r\nAccess to on-campus facilities (e.g., gym, library).\r\nPotential for performance bonuses.\r\nOpportunities for career growth and advancement within the academic institution.', 0, '0', '0', 1, '2024-11-13 19:48:03', '2024-11-13 19:48:03', 19),
(24, '2D Animator', '', 'fullTime', 20500.00, 'We are seeking a skilled 2D Animator to join our creative team at CITE . The ideal candidate will be responsible for creating animated visuals that engage and educate students. ', '1.Proficiency in animation software (such as Adobe Animate, Toon Boom, or After Effects).\r\n2.Strong drawing and sketching skills.\r\n3.Knowledge of the principles of animation (timing, spacing, squash and stretch, etc.).\r\n4.Creativity and attention to detail.\r\n5.Ability to collaborate and communicate effectively within a team.', 'Flexible Hours: Some employers may offer flexible working hours or remote work options, which is especially relevant in creative fields like animation.', 0, '0', '0', 1, '2024-11-22 05:52:59', '2024-11-22 05:52:59', 18),
(25, 'Lab Technicians', '', 'fullTime', 28500.00, 'Support laboratory classes, particularly in sciences like Biology, Chemistry, or Physics.', 'Educational Qualifications:\r\n\r\nMinimum: Bachelor\'s degree in a relevant field (e.g., Biology, Chemistry, Physics, or related sciences).\r\nPreferable: Certifications or diplomas in laboratory technology or applied sciences.\r\nExperience:\r\n\r\nEntry-level: No prior experience required, but internships or lab assistant roles are a plus.\r\nAdvanced: 13 years of lab experience for senior or supervisory positions.\r\nOther Requirements:\r\n\r\nFamiliarity with laboratory safety protocols.\r\nKnowledge of laboratory equipment and its maintenance.\r\nSkills Required\r\nTechnical Skills:\r\n\r\nProficiency in handling lab equipment such as microscopes, spectrometers, and centrifuges.\r\nUnderstanding of chemical handling, preparation of solutions, and biological sample management.\r\n', 'Standard Benefits:\r\n\r\nSSS, PhilHealth, Pag-IBIG contributions.\r\nPaid sick leaves and vacation leaves.\r\nInstitution-Specific Benefits:\r\n\r\nFree or discounted tuition for employees or dependents.\r\nOpportunities for further training and certifications.\r\nAccess to institutional healthcare facilities or HMO coverage.\r\nAdditional Perks:\r\n\r\nProfessional development opportunities, such as workshops or conferences.\r\nFlexible work arrangements during non-lab periods.', 0, '0', '0', 1, '2024-11-22 06:45:14', '2024-11-22 06:45:14', 20),
